import CardNota from "./CardNota";

class ListaDeNotas extends Component {

    render(){
        return(
        <><ul>
                <li>
                    <div>Trabalho</div>
                    <CardNota/>
                </li>
            </ul>
            <ul>
                    <li>
                    <div>Trabalho</div>
                    <CardNota/>
                    </li>
                </ul>
                <ul>
                    <li>
                    <div>Estudos</div>
                    <CardNota/>
                    </li>
                </ul></>

        )
    }
    
}

export default ListaDeNotas;
